caption:
b"As part of our efforts to make the outdoors and the outdoor industry more safe, open and accessible for Black, Indigenous, and people of color, we're proud to be making donations to two key organizations: @naturbanleague and @camberoutdoors.

@naturbanleague is a historic civil rights organization dedicated to eliminating the equality gaps in education, jobs, housing, health and justice for Black and under-resourced urban residents.

@camberoutdoors is a national nonprofit that supports workplace inclusion, equity and diversity across the active-outdoor industries.

These new partners join our ongoing support of organizations such as the @unitedwaygp, which aids under-resourced communities here in Maine; and @trustforpublicland, which focuses on ensuring quality outdoor access for all."
